import React, { Component } from "react";
import TopBar from "./components/header/TopBar";
import SideBar from "./components/sideBar/SideBar";
import Home from "./components/pages/home/Home";

import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

import "./app.css";
import Users from "./components/pages/UsersList/Users";

function App() {
  return (
    <Router>
      <TopBar />
      <div className="container">
        <SideBar />
        <Routes>
          <Route exact path="/" component={Home} />
          {/** exact is to make sure that this is the home page, the router when
           * look for other paths like /users will return you back to the home page
           * cause it's think that you still
           * in the same path that why exact is important
           */}
          <Route path="/users" component={Users} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
